import React from "react";
import TicketsList from "../components/TicketsList";
import TicketForm from "../components/TicketForm";

const UserDashboard: React.FC = () => {
    return (
        <div>
            <h1>User Dashboard</h1>
            <TicketForm />
            <TicketsList />
        </div>
    );
};

export default UserDashboard;
